import Card from "@mui/material/Card";
import CardHeader from "@mui/material/CardHeader";
import Avatar from "@mui/material/Avatar";
import { red } from "@mui/material/colors";
import { Stack, Typography, useTheme } from "@mui/material";

export default function FollowingProfile() {
  return (
    <>
      <Card>
        <CardHeader
          avatar={
            <Avatar sx={{ bgcolor: red[500] }} aria-label="following-name">
              R
            </Avatar>
          }
          title="Tony Stark"
          subheader="I. am. IronMan."
        />
      </Card>
    </>
  );
}

export const FollowingList = () => {
  const theme = useTheme();
  return (
    <>
      <Stack
        width={"100vw"}
        justifyContent={"center"}
        alignItems={"center"}
        spacing={2}
        // height={"100vh"}
        minHeight={"100vh"}
        overflow={"auto"}
        mt={2}
        sx={{ marginLeft: { xs: "0px", sm: "75px", md: "200px", lg: "200px" } }}
      >
        <FollowingList />

        <Typography variant="p" sx={{ fontSize: "30px" }} color="primary">
          End of Posts!
        </Typography>

        <div>
          <svg width={100} height={50}>
            <rect
              width="100%"
              height={50}
              fill={theme.palette.background.default}
            ></rect>
          </svg>
        </div>
      </Stack>
    </>
  );
};
